(()=>{var e=document.querySelector(".Forget"),r=document.querySelector(".Cancel"),t=document.querySelector(".login-form"),o=document.querySelector(".forget-form");e!=null&&e.addEventListener("click",()=>{t.style.display="none",o.classList.remove("forget")});r!=null&&r.addEventListener("click",()=>{t.style.display="unset",o.classList.add("forget")});})();
